import React from 'react';
import Navbar from './siteComponents/Navbar';
import Footer from './siteComponents/Footer';
import About from './siteComponents/About';
import Help from './siteComponents/Help';
import PushFitApp from '../components/appComponents/PushFitApp';
import {Switch, Route } from "react-router-dom";

class Home extends React.Component {


    componentDidMount(){
        window.scrollTo(0, 0)
    }

    render(){
        return(
            <Route>
                <div>
                    {(this.props.url === 'pushfitapp')? null : <Navbar toggle={this.togglePages} mainToggle={this.props.toggle}/>}
                    <Switch>
                        <Route path="/" exact component={About}/>
                        <Route path="/help" component={Help}/>
                        <Route path="/pushfitapp" component={PushFitApp}/>
                    </Switch>
                    {(this.props.url === 'pushfitapp')? null : <Footer toggle={this.togglePages}/>}
                </div>
            </Route>
        )
    }
};

export default Home;
